import React from "react";
import ReactDOM from "react-dom/client";
import InventoryApp from "./App";

// TEMP SESSION MOCK
const mockSession = {
  username: "Louie",   // or any test username
  role: "admin",        // or "user" to test user view
};

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(<InventoryApp session={mockSession} />);
